// import {Header} from './Header.jsx'
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <script src="https://kit.fontawesome.com/8acce5eeb9.js" crossorigin="anonymous"></script>
      <nav className="app_header">
        <div className="menu" align='left'>123</div>
        <div className="logo" align='center'>
          <a href="">TaeTaeBlog</a>
        </div>
        <div className="search" align='right'>
          <i className="fa-solid fa-magnifying-glass">123</i>
        </div>
      </nav>
    </div>
  );
}

export default App;
